  "short_description": "Go to party planet. Love and be loved by drugs.",
  "long_description": "COOL FOR: HIGH-FLIERS. PARTY ENTHUSIASTS. COPS WHO NEED LIGHTNING.\n\nElectrochemistry is the animal within you, the beast longing to be unleashed to indulge and enjoy. It enables you to take drugs with fewer negative side-effects. It also enables you to better investigate lurid matters – if you need to understand a chemical breakdown, or talk to someone blasted out of their mind, or understand sexual dynamics, Electrochemistry is there to guide you.\n\nAt high levels, Electrochemistry makes you a man of unrestrained pleasure – an unrepentant lothario who leers at people with a bottle of speed and a plastic bendy straw in either hand. But with a low Electrochemistry, you’ll be too innocent to be effective. Without a working knowledge of drugs and sex, the city will be difficult to understand.",
  "color": 4
}
